import React, { Component } from 'react';
import Avo from './avo';
import MyContext from './myContext';

export default class Bisavo extends Component {
  constructor() {
    super();

    this.setState = {
      money: 100000,
    }
  }
  render() {
    return (
    <MyContext.Provider value>
        <>
          <p>Bisavo</p>
          <Avo />
        </>
    </MyContext.Provider>
    );
  }
}
